'use strict';
let TerminalBuilder = require('./TerminalBuilder.js');
//@@DocBrief("The factory for creating terminals")
class TerminalFactory {
    createTerminal(type, name, status, inactiveText, urls) {
        let builder;
        builder = new TerminalBuilder();
        builder.setType(type);
        builder.setName(name);
        builder.setStatus(status);
        builder.setInactiveText(inactiveText);
        builder.setUrls(urls);
        builder.setType(type);
        builder.setStreams(new Array(0));
        return builder.build();
    }
    createTerminalWithStreams(type, name, status, inactiveText, urls, streams, subId, id) {
        let builder;
        builder = new TerminalBuilder();
        builder.setType(type);
        builder.setName(name);
        builder.setStatus(status);
        builder.setInactiveText(inactiveText);
        builder.setUrls(urls);
        builder.setType(type);
        builder.setSubId(subId);
        builder.setId(id);
        builder.setStreams(streams);
        return builder.build();
    }
}
module.exports = TerminalFactory
